import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div style={{ 
      textAlign: 'center', 
      marginTop: '100px', 
      fontFamily: 'Arial' 
    }}>
      <h1>Welcome to Aptitude Prep Project</h1>
      <p>Start your journey to practice aptitude tests.</p>
      <div style={{ marginTop: '20px' }}>
        <Link 
          to="/login" 
          style={{ 
            textDecoration: 'none', 
            padding: '10px 20px', 
            backgroundColor: 'green', 
            color: 'white', 
            borderRadius: '5px', 
            marginRight: '10px' 
          }}
        >
          Login
        </Link>
        <Link 
          to="/signup" 
          style={{ 
            textDecoration: 'none', 
            padding: '10px 20px', 
            backgroundColor: 'darkgreen', 
            color: 'white', 
            borderRadius: '5px' 
          }}
        >
          Signup
        </Link>
      </div>
    </div>
  );
};

export default Home;
